import React, { useEffect, useState } from "react";
import "./main.css";
import "./processing.css";
import { Link, useNavigate } from "react-router-dom";

function Processing() {
  const [status, setStatus] = useState({
    objectDetection: "pending",
    musicRecommendation: "pending",
    emotionAnalysis: "pending",
    storyGeneration: "pending",
  });

  const navigate = useNavigate();
  const keyword = localStorage.getItem("selectedKeyword") || "";

  const statusIcons = {
    completed: `${process.env.PUBLIC_URL}/fyp-images/tick.png`,
    processing: `${process.env.PUBLIC_URL}/fyp-images/inprogress.png`,
    pending: `${process.env.PUBLIC_URL}/fyp-images/pending.jpeg`,
  };

  useEffect(() => {
    const interval = setInterval(async () => {
      try {
        const res = await fetch("http://127.0.0.1:5000/status");
        if (!res.ok) throw new Error("Backend error");
        const data = await res.json();

        // Safe defaulting
       const currentStatus = data?.status || {};
setStatus(currentStatus);

const allCompleted = Object.values(currentStatus).every(
  s => String(s).toLowerCase() === "completed"
);

if (allCompleted) {
  clearInterval(interval);

  const result = data?.result || {};
  localStorage.setItem("detected_objects", JSON.stringify(result.detected_objects || []));
  localStorage.setItem("dominant_emotion", result.dominant_emotion || "neutral");
  localStorage.setItem("recommended_song", JSON.stringify(result.recommended_song || {}));
  localStorage.setItem("generated_story", result.generated_story || "");

  navigate("/result");
}

      } catch (err) {
        console.error("Processing error:", err);
      }
    }, 1000);

    return () => clearInterval(interval);
  }, [navigate]);

  const progress = (Object.values(status).filter(s => s === "completed").length / 4) * 100;

  // Mapping step names for display
  const stepNames = {
    objectDetection: "Object Detection",
    musicRecommendation: "Music Recommendation",
    emotionAnalysis: "Facial Expression Analysis",
    storyGeneration: "Story Generation",
  };

  return (
    <div className="keyword-page">
      <h1 className="top-heading">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
          width="50"
          height="55"
          alt="MoodMelody Logo"
        />{" "}
        MoodMelody
      </h1>

      <p className="top-Description">AI Processing in Progress</p>

      <div className="uploads-flex">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/vedio.jpg`}
          alt="Video"
          className="vedio-icon"
        />
        <h3 className="keyword-heading">Keyword = “{keyword || "—"}”</h3>
      </div>

      <div className="progress-bar">
        <div className="progress-fill" style={{ width: `${progress}%` }}></div>
      </div>

      <div className="processing-content">
        <div className="processing-steps">
          {Object.keys(status).map((step) => (
            <div className="step" key={step}>
              <img
                src={statusIcons[status[step]]}
                alt={status[step]}
                className="step-icon"
              />
              <p>{stepNames[step]}</p>
            </div>
          ))}
        </div>

        <div className="status-section">
          {Object.keys(status).map((step) => (
            <p key={step}>
              {status[step] === "completed"
                ? "Completed"
                : status[step] === "processing"
                ? "Processing..."
                : "Pending"}
            </p>
          ))}
        </div>
      </div>

      <button className="cancel-btn" onClick={() => navigate("/keyword")}>
        Cancel Processing
      </button>

      <nav aria-label="Page navigation" className="page-nav">
        <ul className="pagination-nav">
          <li className="page-item">
            <Link to="/keyword" className="page-link">
              <img
                src={`${process.env.PUBLIC_URL}/fyp-images/previous.png`}
                width="40"
                height="45"
                alt="Previous"
                className="previous"
              />
            </Link>
          </li>
          <li className="page-item next-link">
            <Link to="/result" className="page-link">
              <img
                src={`${process.env.PUBLIC_URL}/fyp-images/next.png`}
                width="40"
                height="45"
                alt="Next"
                className="next"
              />
            </Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Processing;
